webpackJsonp([62215911513534],{7724:function(e,t){e.exports={data:{post:{html:"<p>Noone appreciated my <a href=\"http://lumma.de/eintrag.php?id=3082\">election day humor</a> at lumma.de, so I'll repeat myself here. Nico offered the famous quote:</p>\n<blockquote><p>\n  I tend to think politicians should be changed often, just like diapers, and for exactly the same reason.\n</p></blockquote>\n<p>He suggested it applied just as well to Germany, to which I replied:</p>\n<blockquote><p>\n  Does that mean grand coalitions need to be changed more frequently?\n</p></blockquote>\n<p>Thank you, thank you, I'm here all week. Or until the recount in Virginia is over.</p>",fields:{title:"Macaca!",date:"08 Nov 2006",url:"https://papascott.de/2006-11-08-macaca/"}}},pathContext:{slug:"/2006-11-08-macaca/",prev:{fields:{title:"That's Me in the Corner",date:"03 Nov 2006",slug:"/2006-11-03-thats-me-in-the-corner/"}},next:{fields:{title:"We Don't Need No Education",date:"08 Nov 2006",slug:"/2006-11-08-we-dont-need-no-education/"}}}}}});
